import worldLogo from './WorldLogo';

const Home = (prop)=>{
    if(prop.home){
        return(
            <div className="home">
                <h1>Welcome </h1>
                <img src={worldLogo} />
            </div>
        );
    }
    return(
        <></>
    );
}

export default Home;
